import React from 'react';
import { Link } from 'react-router-dom';
import './AboutPage.scss';
import home from '../../assets/images/home.png'

export default function AboutPage() {
    return (
        <div className="about">
            <h1>About Drawllab</h1>
            <p>Drawllab is a browser based whiteboard and drawing application. Using Drawllab, multiple users can work on the same canvas simultaneously.</p>

            <div className="nav">
                <Link to="/canvas">
                    Back to Canvas
                </Link>
                <Link to="/">
                    <img src={home} alt="" className="nav__icon" />
                </Link>
            </div>
        </div>
    )
}
